import  axios from "axios";

const API_URL = "http://localhost:8080";


const login = data => {
    return axios.post(API_URL + "/api/login", data);
};

const register = data =>{
    return axios.post(API_URL + "/apiv1/motorist/save", data);
}


export default {
    login,
    register,
};
